description:
Dive into outer space with Astro Shark to save his abducted love, Laika, the Russian space dog.

INTERGALACTIC ADVENTURE
Travel to the end of the Universe and beyond to meet new friends in this gorgeously hand illustrated tale. Outsmart your pursuers, collect stars and beat everyone on the leaderboards!

ADDICTIVE GAMEPLAY
Each level in Astro Shark will challenge you to master new game mechanics while constantly improving your rocket-evasion skills!

Astro Shark is a brand new game from the creators of Electric Tentacle and Nano Panda.

